import React from 'react';

const Watchnow =(props) =>{
   
};


const Navbar = (props) => {
    const number = props.id;
    // const Watching = () =>{
    //     alert(`i m watching ${number} `);
    //     <Watchnow id = {number}/>;
    // };
    return (
        <>
        <div className = {`container ${props.btao}`}>
            <div className = "images">
                <img src = {props.images}/>
            </div>
            <div className = "sec">
            <div className = "about">
                <h3> {props.title}</h3>
                <p> {props.btao} </p>
                <p> {props.date}</p>
            </div>
            <div className = "buttons">
                {/* <button onClick = {props.links} > Watch Now</button>
                <button> Add to Wishlist</button> */}
                <a href = {props.links} target = "_blank"><i class="far fa-play-circle"></i></a>
                <a>Wacthlist</a>
            </div>
            </div>
        </div>
        </>
    )
}

export default Navbar;
export {Watchnow};
